import React from 'react';
import Forward10Icon from '@material-ui/icons/Forward10';
import Replay10Icon from '@material-ui/icons/Replay10';
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import PauseIcon from '@material-ui/icons/Pause';
import VolumeMuteIcon from '@material-ui/icons/VolumeMute';
import VolumeDownIcon from '@material-ui/icons/VolumeDown';
import VolumeUpIcon from '@material-ui/icons/VolumeUp';
import VolumeOffIcon from '@material-ui/icons/VolumeOff';
import HelpOutlineIcon from '@material-ui/icons/HelpOutline';
import SubtitlesIcon from '@material-ui/icons/Subtitles';
import SkipNextIcon from '@material-ui/icons/SkipNext';
import Episodes from '@material-ui/icons/AmpStories';
import SpeedIcon from '@material-ui/icons/Speed';
import FullscreenIcon from '@material-ui/icons/Fullscreen';
import FullscreenExitIcon from '@material-ui/icons/FullscreenExit';
import { StylesProvider } from '@material-ui/styles';


function Controls() {
  return <div className = "controls">
  <button><PlayArrowIcon /></button>
  <button><Replay10Icon /></button>
  <button><Forward10Icon/></button>
  <button><VolumeDownIcon/></button>
  <p>
    <span className = "title">title</span>
    <span className = "episode"> episode</span>
  </p>

  <button><HelpOutlineIcon/></button>
  <button><Episodes/></button>
  <button><SubtitlesIcon/></button>
  <button><SpeedIcon /></button>
  <button><FullscreenIcon /></button>
  </div>;
}


export default Controls;
